<script>
    var arr = [1,1,2,3,4,5,3,4,5,10,11,12,12]


    for(var i =0;i<arr.length;i++){
        var flag =0;
        for(var j=i+1;j<arr.length;j++){
            if(arr[i]==arr[j]){
                flag = 1;
                arr[j] = -1;
            }
            if(flag == 1){
                arr[i] = -1;
                break;
            }
        }
    }

    var dup = [];
    for(var i=0;i<arr.length;i++){
        if(arr[i] != -1)
        {
            dup.push(arr[i])
        }
    }
    document.write(dup)
</script>
